### Describe the issue

When trying to create a new model using `InferenceSession.create`, the following error is thrown:
```
Error: no available backend found. ERR: [wasm] RuntimeError: Aborted(LinkError: WebAssembly.instantiate(): Import #41 module="a" function="P" error: function import requires a callable). Build with -sASSERTIONS for more info., [cpu] Error: previous call to 'initializeWebAssembly()' failed., [xnnpack] Error: previous call to 'initializeWebAssembly()' failed.
```
This only started when I upgraded from v1.14.0 to v1.15.1. Downgrading back to v1.14.0 (without changing anything else about my application) resolves the problem.

*.wasm files are served properly; 200 OK responses are returned. This is within an application bootstrapped using create-react-app.

### To reproduce

* Use create-react-app to instantiate a new project
* Import onnxruntime-web: `import * as ort from 'onnxruntime-web';`
* Import InferenceSession: `import { InferenceSession } from 'onnxruntime-web';`
* Configure ort env:
```
// onnxruntime
ort.env.debug = false;
ort.env.wasm.simd = true;

// set global logging level
ort.env.logLevel = 'verbose';

// override path of wasm files - for each file
ort.env.wasm.wasmPaths = {
    'ort-wasm.wasm': '/ort-wasm.wasm',
    'ort-wasm-simd.wasm': '/ort-wasm-simd.wasm',
    'ort-wasm-threaded.wasm': '/ort-wasm-threaded.wasm',
    'ort-wasm-simd-threaded.wasm': '/ort-wasm-simd-threaded.wasm',
};
```
* Try to create an inference session:
```
useEffect(() => {
    const initModel = async () => {
        const newModel = await InferenceSession.create('./path/to/file.onnx');
        // do stuff
    };
    initModel();
}, []);
```

### Urgency

_No response_

### ONNX Runtime Installation

Released Package

### ONNX Runtime Version or Commit ID

1.15.1

### Execution Provider

'wasm'/'cpu' (WebAssembly CPU)
